		Navbar.clickSignIn();
		LoginPage.formIsVisible();
		LoginPage.fillForm('username', 'password');
		LoginPage.submitForm();
		Navbar.insideNavBarIsVisible();
		// $('.nav-tabs').waitForExist();
	});

	it('Should logout from app', () => {
		// $('.icon-user').waitForExist();
